import{_ as t,o,c as a,z as e,a as n}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 8.01-633 Damages on dissolution.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-633.md","filePath":"vacode/8.01-633.md"}'),s={name:"vacode/8.01-633.md"},i=e("h1",{id:"§-8-01-633-damages-on-dissolution",tabindex:"-1"},[n("§ 8.01-633 Damages on dissolution. "),e("a",{class:"header-anchor",href:"#§-8-01-633-damages-on-dissolution","aria-label":'Permalink to "§ 8.01-633 Damages on dissolution."'},"​")],-1),d=e("p",null,"When an injunction to stay proceedings on a judgment or decree for money is dissolved wholly or in part there shall be paid to the party having such judgment or decree damages at the rate of ten per centum per annum from the time the injunction took effect until the dissolution, on such sum as appears to be due, including the costs; but the court wherein the injunction is may direct that no such damages be paid, or that there be paid only such portion thereof as it may deem just. In a case wherein a forthcoming bond was forfeited, and no execution was had thereon before the injunction took effect, a court awarding such execution shall include in its judgment or decree damages as aforesaid. In other cases damages may be included in the execution on the judgment or decree to which the injunction was awarded.",-1),r=e("p",null,"Code 1950, § 8-625; 1977, c. 617.",-1),c=[i,d,r];function h(u,l,m,p,f,_){return o(),a("div",null,c)}const j=t(s,[["render",h]]);export{b as __pageData,j as default};
